import React from "react";
import styled from "styled-components";

const TwojaStara = styled.div`
  background-color: #004aad;
  width: 100%;
  height: 100%;
`;

const Cards = styled.div`
    width: 15%;
`;

const Card = () => {
  return <TwojaStara></TwojaStara>;
};

export default Card;
